import { Component } from 'react';

class CardList extends Component {
	render () {
		const { monsters } = this.props;
		console.log({'monsters': monsters});
		console.log('render');

		return (
			<div>
				{
					monsters.map(monster => {
						<div>
							<h1>{monster.name}</h1>
						</div>
					})
				}
			</div>
		);
	}
}

export default CardList;
